import React from 'react'
import { Container, Row, Col, Button } from 'react-bootstrap'
import { useNavigate, useLocation } from 'react-router-dom'
import token from "../img/logo.png";
import '../css/Nav.css'

const NavBar = () => {
  const navigate = useNavigate()
  const location = useLocation()
  const handleonClick = (page) => () => {
    navigate(`/${page}`);
  }
  return (
    <Container className='nav-container'>
      <Row style={{
        display: "flex"
        , justifyContent: "space-around"
      }}>
        <Col className='nav-left'>
          <img src={token} alt='logo' onClick={handleonClick("")} />
        </Col>
        <Col className='nav-middle'>
        </Col>
        <Col className='nav-right'>
          <Button onClick={handleonClick("contact")}> Contact Us </Button>
          <Button onClick={handleonClick("about")}> Profile </Button>

        </Col>
      </Row>
    </Container>
  )
}

export default NavBar;
